actionConfiguration.body:
() => {
		if (GetJobOrderJobResponses.data.data == null) {
			return ""
		}
		for (let i = 0; i < GetJobOrderJobResponses.data.data.getJobOrder.jobResponses.length; i++) {
			let line = GetJobOrderJobResponses.data.data.getJobOrder.jobResponses[0]
			if (selectStocktakeCarrier.selectedOptionValue != "") {
				for (let j = 0; j < line.materialActual.length; j ++) {
					if (line.materialActual[j].carrier != null) {
						if (line.materialActual[j].carrier.code == selectStocktakeCarrier.selectedOptionLabel) {
							return line.id
						}
					}
				}
			} else {
				if (line.materialActual.carrier == null) {
					return line.id
				}
			}
		}
		return ""
	}

